function getTextByLanguage(n) {
    var i, t;
    return !ys.isNullOrEmpty(n) && (i = location.pathname,
    i.indexOf("/en") >= 0 && (t = languageList[n],
    t)) ? t : n
}
function getUrlPrefixByLanguage(n) {
    if (!ys.isNullOrEmpty(n)) {
        var t = location.pathname;
        if (t.indexOf("/en") >= 0)
            return "/en" + n
    }
    return n
}
function isChineseByLanguage() {
    var n = location.pathname;
    return n.indexOf("/en") >= 0 ? !1 : !0
}
